  render() {
      return (
        <TopicWrapper>
          <TopicItem>
            <img
              className="topic-pic"
              src="https://img.51miz.com/Element/01/02/09/52/5d0d28a2_E1020952_dc1c3bf7.jpg"
            ></img>
            社會熱點
          </TopicItem>
        </TopicWrapper>
      );
  }
}



export default connect(mapState,)(Topic);
